import React, { useState } from 'react';
import { Container, CssBaseline, Box } from '@material-ui/core';

export default function Portaria() {
  return (
    <React.Fragment>
      <CssBaseline />
      <Container maxWidth="sm">
        <Box sx={{ bgcolor: '#cfe8fc', height: '100vh' }} />
      </Container>
    </React.Fragment>
  );
}
